  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset includes 10 georeferenced
  images, acquired on July 13, 1950 over portions of Marais des Cygnes National Refuge
  in eastern Kansas.  This data set is a georeferenced version of an original black
  and white aerial photograph downloaded from Earth Explorer (USGS). The original
  photos were georeferenced against the Linn County 2012 NAIP images. This data set
  provides a look back in time at land conditions along a stretch of the Marais des
  Cygnes River which is now part of the refuge. These images (at a resolution of 0.6
  meters) allows a very detailed look at habitats including areas that were cropped,
  native prairie, and woodlands at that time. Change over time estimates can be made
  from this image using current imagery for comparison. This image, and others from
  1950, and 1938, is being used by refuge staff to assist in understanding and visualizing
  the historical content of the lands within the refuge and how they have changed
  over the last 50 years. Pixel resolution of this image is  0.6 meters. This image
  should be used for resource-level interpretation only.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
